import React, { useState } from 'react'
import { Formulario } from './components/Formulario'
import { v4 as uuidv4 } from 'uuid';
import { Tabla, TableRow } from './components/TableRow';
uuidv4();

export const App = () => {

  const products = [
    { id:uuidv4(), category: "Frutas", price: "$1", stocked: true, name: "Manzana" },
    { id:uuidv4(), category: "Frutas", price: "$1", stocked: true, name: "Fruta del drag칩n" },
    { id:uuidv4(), category: "Frutas", price: "$2", stocked: false, name: "Maracuy치" },
    { id:uuidv4(), category: "Verduras", price: "$2", stocked: true, name: "Espinaca" },
    { id:uuidv4(), category: "Verduras", price: "$4", stocked: false, name: "Calabaza" },
    { id:uuidv4(), category: "Verduras", price: "$1", stocked: true, name: "Guisantes" }
  ]

  const [cosas, setCosas] = useState(products)
  const addItem = (item) => {
    setCosas()
  }
  const deleteItem = (id) => {
    setCosas(cosas.filter(item => item.id !== id))
  }
  return (
    <div>
      <h1>LISTA COMPRA</h1>
      <Formulario />
      <table>
        <thead>
          <tr>
            <th>Nombre</th>
            <th>Precio  </th>
          </tr>
        </thead>
        <tbody>
        {
        cosas.map((item) => (
          <TableRow item={item} deleteItem={deleteItem} />
        ))
      }
        </tbody>
      </table>

    </div>
  )
}
